import React, { useEffect, useState } from 'react';
import { Row } from 'react-bootstrap';
import './Class.css';
import { useNavigate } from 'react-router-dom';
import { getAllClasses } from '../services/classService';
import { fetchClasses } from './api';



const Class = () => {
  const [classes, setClasses] = useState([]);
  const [error, setError] = useState(null);
  const navigate = useNavigate();
  const getRandomImageUrl = (id) => `https://picsum.photos/seed/${id}/200/300`;
  
  useEffect(() => {
    const fetchClasses = async () => {
      try {
        const data = await getAllClasses();
        setClasses(data);
      } catch (error) {
        setError('Failed to fetch classes');
      }
    };

    fetchClasses();
  }, []);

  const handleCardClick = (classId) => {
    navigate(`/class/${classId}`);
  };

  return (
    <div className='classes'>
      <h1>Class</h1>
      {error && <p>{error}</p>}
      <Row>
        <div className='content'>
          {classes.map((cls) => (
              <div key={cls.class_id} className='card' onClick={() => handleCardClick(cls.class_id)}>
                <div className='card-image-container'>
                  <img src={getRandomImageUrl(cls.class_id)} alt={cls.title} />
                </div>
                <p className='card-category'>{cls.class_type}</p>
                <p className='card-name'><span>{cls.title}</span></p>
                <p>{cls.description}</p>
                <p>Lesson: {cls.lesson}</p>
                <p>Price: {cls.price}</p>
              </div>
            ))}
          <div key={classes.class_id} className='card' onClick={() => handleCardClick(classes.class_id)}>
            <div className='card-image-container'>
              <img src={getRandomImageUrl('1')} alt='1'/>
            </div>
            <p className='card-category'>Design</p>
            <p className='card-name'><span>Figma UI UX Design</span></p>
            <p>Use Figma to get a job in UI Design, User Interface, User Experience design.</p>
          </div>
          <div key={classes.class_id} className='card' onClick={() => handleCardClick(classes.class_id)}>
            <div className='card-image-container'>
              <img src={getRandomImageUrl('2')} alt='2'/>
            </div>
            <p className='card-category'>Design</p>
            <p><span>Learn With Shoaib</span></p>
            <p>Design Web Sites and Mobile Apps that Your Users Love and Return to Again.</p>
          </div>
          <div key={classes.class_id} className='card' onClick={() => handleCardClick(classes.class_id)}>
            <div className='card-image-container'>
              <img src={getRandomImageUrl('3')} alt='3'/>
            </div>
            <p className='card-category'>Design</p>
            <p><span>Building User Interface</span></p>
            <p>Learn how to apply User Experience (UX) principles to your website designs.</p>
          </div>
          <div key={classes.class_id} className='card' onClick={() => handleCardClick(classes.class_id)}>
            <div className='card-image-container'>
              <img src={getRandomImageUrl('4')} alt='4'/>
            </div>
            <p className='card-category'>Design</p>
            <p className='card-name'><span>Figma UI UX Design</span></p>
            <p>Use Figma to get a job in UI Design, User Interface, User Experience design.</p>
          </div>
          <div key={classes.class_id} className='card' onClick={() => handleCardClick(classes.class_id)}>
            <div className='card-image-container'>
              <img src={getRandomImageUrl('5')} alt='5'/>
            </div>
            <p className='card-category'>Design</p>
            <p><span>Learn With Shoaib</span></p>
            <p>Design Web Sites and Mobile Apps that Your Users Love and Return to Again.</p>
          </div>
          <div key={classes.class_id} className='card' onClick={() => handleCardClick(classes.class_id)}>
            <div className='card-image-container'>
              <img src={getRandomImageUrl('6')} alt='6'/>
            </div>
            <p className='card-category'>Design</p>
            <p><span>Building User Interface</span></p>
            <p>Learn how to apply User Experience (UX) principles to your website designs.</p>
          </div>
        </div>
      </Row>
    </div>
  );
}

export default Class;
